import React from "react";
import { BrowserRouter, Router, Route, Switch } from "react-router-dom";

import Home from "./components/Home";
import Navbar from "./components/Navbar";

function App() {
  return (
    <>
      <BrowserRouter>
        <Navbar />
        <Switch>
          <Router>
            <Route exact path="/" component={Home} />
          </Router>
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
